      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 / CAST ( + + CAST ( NULL AS INTEGER ) AS REAL ) NOT IN ( + - 53 + + + col0, 34, col0 * + + ( col2 ) + col2, + + col0 );
  - name: tab1

outputs:
  - name: q7606.out
    data: |
